INSERT INTO `event` (`eventId`, `eventTitle`, `eventContent`, `eventDate`, `eventImg`, `creatorId`, `location_FK`) VALUES
(93, 'Boğaziçi Marka Sohbetleri 2021', 'Boğaziçi Marka Sohbetleri 22 Aralık\'ta Boğaziçi Üniversitesi\'nde sizlerle!\r\n\r\nBoğaziçi Marka Sohbetleri, marka ve pazarlama alanında kendini geliştirmek isteyen kişileri, alanında markalaşmış isimlerle sohbet havasında bir oturumla buluşturmayı amaçlayan bir etkinliktir. Boğaziçi Marka Sohbetleri\'nin ikincisi 22 Aralık\'ta Boğaziçi Üniversitesinde sizlerle!', '2021-12-26', '87775b66fc593401335e76fb8fc3c52b.jpg', 2, 3),
(94, 'Proje Yönetimi: 2021\'den 2022\'ye', 'Proje yönetimindeki yenilikler Çevikte yeni yaklaşımlar: Disciplined Agile ve Sertifikaları PMP® sınav değişikliği\r\n\r\n23 Aralık 2021 tarihinde Proje İZDüşümleri Webinar serimizin 14. Bölümü “Proje Yönetimi: 2021\'den 2022\'ye” ile 20:30-22:00 saatleri arasında sizlerleyiz!\r\n\r\n• Proje yönetimindeki yenilikler\r\n\r\n• Çevikte yeni yaklaşımlar: Disciplined Agile ve Sertifikaları\r\n\r\n• PMP® sınav değişikliği ve diğer PMI® sertifikasyonları\r\n\r\n• PMP® hazırlık yol haritası\r\n\r\n• Adaptasyon için proje yönetimi olgunluğu, ama nasıl?\r\n\r\nve daha fazlasının yanıtlarını alacağımız etkinliğimizde Sn. Dilek Koçak,PMP ve Sn. Selda Barbaros, PMP bizlerle olacak!\r\n\r\nWebinar kayıt formu: https://docs.google.com/forms/d/e/1FAIpQLScnwYFrIvSfD1WqhkACYrk0Z_EPDZdTHw44Hlx4yil36GO8xw/viewform\r\n\r\nNot: Etkinliğimiz Zoom platformu üzerinden gerçekleştirilecektir ve ücretsizdir. Eş zamanlı olarak Youtube üzerinden de izlenebilecektir.\r\n\r\n*Etkinliğimiz 1 Teknik PDU değerindedir.\r\n\r\n*Etkinlik sonrası webinar kaydının youtube linki ve haber görselini PDU için kanıt belgesi olarak kullanabilirsiniz.\r\n\r\nYoutube Kanalımız: https://www.youtube.com/channel/UCeSa9Hr95GEj3MG2GhPwEXA\r\n\r\n*Proje İZDüşümleri Webinarları serimizin önceki bölümlerine Youtube Kanalımızdan ulaşabilirsiniz.', '2021-12-23', '46ca00c8c4c5f1374726309f73bb0065.jpg', 2, 2),
(95, 'Product Hunt Istanbul Meetup: Women in Tech Night', 'We aim to encourage women to step into the field of tech. Let\'s share, learn & have fun!\r\nAbout this event\r\nWomen in Tech Night\r\nPanel: Step into Tech Industry\r\n\r\nSpeakers:\r\n\r\nBengü Vefa (Global AI Hub - Head of Global Partnerships Team )\r\nMerve İşler (Google - Developer Relations Coordinator)\r\nMina İlköz (Co-Founder - Up School)\r\nModerator:\r\n\r\nTuğçe İçözü (Product Hunt Ambassador)\r\nWomen Techmakers\r\n\r\n#IamRemarkable Workshop - Gül Ceren Tunay & Berfin Karaca\r\nHow to become a developer? - Esra Kadah\r\nWe aim to encourage women to step into the field of tech and development. Let\'s share & have fun!\r\n\r\nOur maximum capacity for the venue is limited due to the Covid-19 situation.\r\n\r\nDo not forget to fill out the form:\r\nhttps://forms.gle/R1z35zobABGtaaAd7\r\n\r\nEVENT DETAILS\r\nWhat: The Product Hunt Meetup in Istanbul\r\n\r\nWhere: Assembly Ferko Signature - 175 Büyükdere Cd. 34394 Levent, ISTANBUL\r\n\r\nWhen: 23.12.2021\r\n\r\nThe Night\'s Theme: Women in Tech\r\n\r\nREQUIREMENTS\r\nTo join the event, you must:\r\n\r\n- Have a profile on Product Hunt (don\'t have one yet? Set it up here!)\r\n\r\n- Please do wear a mask when you do not eat or drink.\r\n\r\n- Also we do temperature check is required at the entrance.\r\n\r\nTeknolojide Kadınlar\r\nPanel: Teknoloji sektörüne adım atmak\r\n\r\nKonuşmacılar:\r\n\r\nBengü Vefa (Global AI Hub - Head of Global Partnerships Team )\r\nMerve İşler (Google - Developer Relations Coordinator)\r\nMina İlköz (Co-Founder - Upschool)\r\nModeratör:\r\n\r\nTuğçe İçözü (Product Hunt Ambassador)\r\nWomen Techmakers\r\n\r\n#IamRemarkable Atölyesi - Gül Ceren Tunay & Berfin Karaca\r\nGeliştirici dünyasına adım atmak - Esra Kadah\r\nFormu doldurmayı unutmayın:\r\nhttps://forms.gle/R1z35zobABGtaaAd7\r\n\r\nKadınları teknoloji alanına adım atmaya teşvik etmeyi amaçlıyoruz. Paylaşalım, öğrenelim ve eğlenelim!\r\n\r\nCovid-19 nedeniyle maksimum katılımcı sayımız sınırlıdır.\r\n\r\nETKİNLİK DETAYLARI\r\nNe: Product Hunt Istanbul Meetup\r\n\r\nNerede: Assembly Ferko Signature - 175 Büyükdere Cd. 34394 Levent, ISTANBUL\r\n\r\nNe zaman: 23.12.2021\r\n\r\nEtkinlik teması: Teknolojide kadınlar\r\n\r\nKATILIM KOŞULLARI\r\nEtkinliğe katılmak için;\r\n\r\n- Product Hunt\'ta profiliniz olması gerekiyor (Henüz oluşturmadınız mı? Hemen kaydolun!)\r\n\r\n- Lütfen maske takın.\r\n\r\n- Girişte ateş ölçümü ve aşı kartı kontrolü yapılmaktadır.\r\n\r\n- Kişi 2 doz aşılı değil veya negatif PCR testi yok ise etkinliğe katılmasına müsaade edilmeyecektir. Kişinin 2 doz aşılı sayılabilmesi için 2. doz aşısının üzerinden 14 gün geçmiş olması gerekmektedir.', '2021-12-23', '2402bdf8496a5b1984f8624c94812d26.jpg', 73, 3),
(96, 'Ankara Girişimcilik Zirvesi 2021', 'Ankara Girişimcilik Zirvesi 2021\r\nAbout this event\r\nGlobal Girişimcilik Haftası (GGH) kapsamında, TOBB Ankara Genç Girişimciler Kurulu koordinatörlüğünde 17 Kasım 2021 Çarşamba günü 10:00-16:00 saatleri arasında Ankara Ticaret Odası Meclis Salonunda düzenlenecek “Ankara Girişimcilik Zirvesi 2021” Etkinliğine davetlisiniz.\r\n\r\nEtkinlik Programı\r\n\r\n10:00-10:30 Açılış Konuşmaları\r\n\r\nHakan Tarhan - Data Mind Kurucu Ortağı - TOBB Ankara Genç Girişimciler Kurulu İcra Komite Başkanı\r\nSezai Hazır - TOBB Genç Girişimciler Kurulu Başkan Yardımcısı - Habitat Derneği Yönetim Kurulu Başkanı\r\nGürsel Baran - Ankara Ticaret Odası Yönetim Kurulu Başkanı\r\n10:30 - 11.00 YARATICI ENDÜSTRİLER VE YENİ MEDYA\r\n\r\nModeratör: Adil Oran - ODTÜ İletişim Fakültesi Öğretim Görevlisi\r\n\r\nCansu Ataman - British Council Yaratıcı Ekonomi Program Müdürü\r\nTürkü Oktay - Onedio Kurucu Ortağı\r\nTuncay Dakdevir - Artiox Kurucu Ortağı\r\n11:00 - 11:45 LOCAL TO GLOBAL - ANKARA\'DAN BÜYÜME HİKAYELERİ\r\n\r\nModeratör: Ece İdil Kasap - ANDAR CEO Ofis Koordinatörü\r\n\r\nFerit Ozan AKGÜL - Mall IQ Kurucu Ortak & CTO\r\nPırıl Kavlak - Thundra Dijital Pazarlama Yöneticisi\r\nVolkan Ertürk - Picus Security Kurucu Ortağı\r\n11:45 - 12:30 DÖNGÜSEL EKONOMİ VE YEŞİL TEKNOLOJİLER\r\n\r\nModeratör: Alev Ertem - Endeavor İletişim ve Pazarlama Direktörü\r\n\r\nKerem Erikçi - İklim.co & Biftek.co Kurucu Ortağı\r\nMerve Arıkan - Plastic Move Kurucu Ortağı\r\nMert Barutçu - Evreka Kurucu Ortağı\r\n12:30 - 13:30 ÖĞLE YEMEĞİ\r\n\r\n13:30 - 14:15 ANKARA\'DA GİRİŞİMCİLİK EKOSİSTEMİ VE KAMU FİNANSMAN DESTEĞİ\r\n\r\nModeratör: Ozan Acar - Trendyol İcra Kurulu Üyesi & GEN Türkiye Yönetim Kurulu Üyesi\r\n\r\nBaşak Özcan - ODTÜ Teknokent Programlar Yönetici\r\nDr. Cahit Çelik - Ankara Kalkınma Ajansı Genel Sekreteri\r\nEvren Bükülmez - TTGV HİT Program Yöneticisi\r\nElif Koşok - TÜBİTAK TEYDEB Girişim Sermayesi Destekleme Grup Koordinatörü\r\nKamil Akpınar - KOSGEB Teknoloji, Yenilik ve Yerlileştirme Dairesi Başkanlığı KOBİ Uzmanı\r\n14: 15 - 15:00 GİRİŞİMCİLİK FİNANSMANI VE YATIRIM ORTAMI\r\n\r\nModeratör: N.Barış Okur - Viveka Kurucu Ortağı\r\n\r\nAltan Küçükçınar - Diffusion Capital Partners Ortağı\r\nAslı Kurul Türkmen - Endeavor Türkiye Genel Sekreteri\r\nAyşe İnal - Revel Games Kurucu Ortakğı - Q Angels Başkanı\r\nTunya Irkad - 500 Istanbul Yatırım Analisti\r\n15:00 - 15:45 ÖZEL SEKTÖR- START UP İŞBİRLİĞİ MODELLERİ\r\n\r\nModeratör: İlter Haliloğlu - Viveka COO\r\n\r\nAykut Hocaoğlu - Arçelik Garage Startup Program Koordinatörü\r\nBurak Elibol - Enerjisa Teknoloji Geliştirme Takım Lideri\r\nKerem Özsü - Eventgates Kurucu Ortağı\r\nVolkan Özdemir - Brisa Bridegestone Sabancı, Girişimcilik Müdürü\r\n15:45 - 16:30 GELENEKSEL TİCARETTEN YENİ NESİL GİRİŞİMCİLİĞE GEÇİŞ\r\n\r\nModeratör: Dilek Şen Güven - Prosis Danışmanlık Kurucu Ortağı, ASİAD Başkan Yardımcısı\r\n\r\nMehmet Özbey - Swordsec Melek Yatırımcısı\r\nMehmet Toprak - Stratejik ve İnovatif Yatırımlar Derneği Yönetim Kurulu Başkanı\r\nSelim Gökşin - Ecanta.com.tr Kurucu Ortağı', '2021-11-17', '606e489f314a05b8a6bbbf7440f8c6bf.jpg', 72, 2),
(97, 'The New Karaoke in Ankara Old Town Pub', 'Her Cuma ve Cumartesi, The New Karaoke Ankara\'da! Now you can #singyourheartout every Friday & Saturday in Ankara!\r\nAbout this event\r\nŞehre The New Karaoke\'yi Getirdik!\r\n\r\nHer Cuma & Cumartesi Yeni Konseptimizle Sizlerleyiz!\r\n\r\n8000\'den Fazla Şarkı ve Ödüllerle Yeni Eğlenceniz!\r\n\r\nRezervasyon ve Daha Fazla Bilgi için : (0312) 426 30 75\r\n\r\nSong List:\r\n\r\nhttp://theoldtown.karaoke.ist/\r\n\r\nEnglish: We Brought the New Karaoke to the Town!\r\n\r\nWe are with you with our new concept every Friday & Saturday!\r\n\r\nYour New Entertainment with 8000+ Songs and Awards!\r\n\r\nFor Reservation and More Information: (0312) 426 30 75\r\n\r\nAdres/Location : Barbaros Mah., Tunalı Hilmi Cd. No:89 D:69, Çankaya/Ankara', '2021-12-24', '6dd1801f9b591d77c0fdda845ab1a413.jpg', 2, 2),
(98, 'Ankara Interlanguage Club - Mery Christmas', 'Dear Interlanguage Family, we have received messages from many of you that you miss us. We miss you too.???? We\'re sorry we haven\'t been able to hold events for a while.\r\n\r\nBut now we have good news for you. ❄️We will come together with a nice organization this Wednesday. We need support on this. You can support us to keep the Christmas spirit alive.???? How Does? You can join event, share with your friends, you can bring small gifts for the attendees, you can bring some small snacks for the day, you can donate decorations to us.????\r\n\r\nPlease message us, make a reservation and learn the details. +905445408827 ????A limited number of people will be able to attend the event, as the venue is a boutique place reserved exclusively for us.\r\n\r\nThank you very much for supporting us.✌????We are grateful for a healthy brand new year for all of us.????\r\n\r\n#christmas #christmastree #christmasdecor #xmas #love #merrychristmas #christmastime #handmade #winter #santa #christmasgifts #christmasiscoming #christmasdecorations #christmaslights #santaclaus #natale #gift #instagood #art #holidays #snow #holiday #family #gifts #noel #photography #navidad #homedecor #christmascountdown', '2021-11-22', 'ce315ca09abd5ee6f2410aff847c93a4.jpg', 2, 2);

